import './Nav.css';
import { Link} from 'react-router-dom';
//import { HashLink} from 'react-router-hash-link';
import { useState, useEffect } from 'react';
import Auth from '../AuthComponent/Auth';
function Nav()
{ 
        const handleLink=()=>{
            const element =document.getElementById
        };

    const [NavContent , setNavContent]=useState();
    useEffect(()=>{
        if(localStorage.getItem("token")!=undefined && localStorage.getItem("role")=="admin")
        {
                setNavContent(<>
                 {/* Navbar Start */}
    <div class="container-fluid p-0">
        <nav class="navbar navbar-expand-lg bg-dark navbar-dark py-3 py-lg-0 px-lg-5">
            <a  class="navbar-brand d-block d-lg-none">
                <h1 class="m-0 display-5 text-capitalize font-italic text-white"><span class="text-primary">Pawn</span>Store</h1>
            </a>
            <button type="button" class="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse justify-content-between px-3" id="navbarCollapse">
                <div class="navbar-nav mr-auto py-0">
                    <a  class="nav-item nav-link active" ><Link to="/admin" style={{"color":"#f8f7f5"}}> Admin Home</Link></a>
                    <a  class="nav-item nav-link" ><Link to="/manageusers" style={{"color":"#f8f7f5"}}> Manage Users</Link></a>
                    <div class="nav-item dropdown">
                        <a href="#" class="nav-link dropdown-toggle" data-toggle="dropdown">Setting</a>
                        <div class="dropdown-menu rounded-0 m-0">
                            <a href="" class="dropdown-item"><Link to="/cpadmin">Change Password</Link></a>
                            <a href="" class="dropdown-item"><Link to="/epadmin">Edit Profile</Link></a>
                        </div>
                    </div>
                    <a  class="nav-item nav-link" ><Link to="/taskusers" style={{"color":"#f8f7f5"}}> Task Users</Link></a>
                </div>

                <a class="btn btn-lg btn-primary px-3 d-none d-lg-block"><Link to="/logout" style={{"color":"#f8f7f5"}}>Log Out</Link></a>
            </div>
        </nav>
    </div>
    {/* Navbar End */}
                </>);
        }
        else if(localStorage.getItem("token")!=undefined && localStorage.getItem("role")=="user")
        {
            setNavContent(<>
                {/* Navbar Start */}
   <div class="container-fluid p-0">
       <nav class="navbar navbar-expand-lg bg-dark navbar-dark py-3 py-lg-0 px-lg-5">
